import React from 'react';

const UserOpenOrder = () => {
  return (
    <div>
      <div>
        <h1>Hi Lars</h1>
        <span>10 task pending</span>
      </div>
      <div className='user-'>
        <img
          src="http://radiotape.de/wp-content/uploads/2015/12/Lars.png"
          alt="Lars"
        />
      </div>
    </div>
  );
};

export default UserOpenOrder;
